import React from 'react';
import { Link } from 'react-router-dom';
import content from './content';

const Contentlist = () => (
    <>
    <h1>Articles</h1>
    {content.map((content, key) => (
        <Link key= {key} to={`/content/${content.name}`}>
        <h3>{content.title}</h3>
        </Link>
    ))}
    </>
);

export default Contentlist;
